from colorama import Fore  # для изменения цвета (не обязательно)from aiogram import Bot , typesfrom aiogram.dispatcher import Dispatcherfrom aiogram.types import messagefrom aiogram.utils import executorfrom config import TOKENbot = Bot(token=TOKEN)dp = Dispatcher(bot)@dp.message_handler(commands=['start'])async def process_start_command(message: types.Message):    await message.reply("")print(Fore.LIGHTYELLOW_EX + "Bot started!")if __name__ == '__main__':    executor.start_polling(dp)